import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="hero-container">
          <h1 className="hero-title">Danny Garcia</h1>
          <p className="hero-subtitle">
            Senior frontend engineer with over a decade of experience building great user experiences.
          </p>
        </div>
      </header>
    </div>
  );
}

export default App;
